import React from 'react';
import Discovery from './discovery'
import Invite from './invite'
import Support from './support'
import './navigation.css'
import AppBar from '@mui/material/AppBar';

function App() {
    return (
        <div>
            <AppBar className = 'Navbar'>
                 <Discovery /><br></br>
                 <Invite />
                 <Support />
            </AppBar>
        </div>
    )
}

export default App
